import React, { Component } from 'react';
import "../styles/aboutMe.css"

class AboutMe extends Component {
    render() {
        return (
            <div className="aboutMe">
                <div className="bio"></div>
                <div className="resume"></div>
            </div>
        );
    }
}

export default AboutMe;
